    @staticmethod
    def plot(oFile=None):
        agglo = GeoDataFrameDemosD.rennesMetropole()
        commune = GeoDataFrameDemosD.villeDeRennes()
        intraperiph = GeoDataFrameDemosD.intraPeripheriqueRennes()

        # MAPPING
        minx, miny, maxx, maxy = agglo.total_bounds

        fig, ax = plt.subplots(figsize=(0.7 * 8.26, 1 * 8.26))
