        commune.boundary.plot(ax=ax, color="blue")
        intraperiph.boundary.plot(ax=ax, color="brown")

        ax.axis("off")
        ax.axis([minx, maxx, miny, maxy])
        if oFile is None:
            fig.tight_layout()
            plt.show()
        else:
            plt.savefig(oFile, bbox_inches="tight")
        plt.close(fig)


